/*Table structure for table `accounts` */

DROP TABLE IF EXISTS `accounts`;

CREATE TABLE `accounts` (
  `acc_no` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `acc_hol_name` varchar(100) DEFAULT NULL,
  `acc_type` varchar(20) DEFAULT NULL,
  `amount` int(11) DEFAULT NULL,
  `acc_hold_addr` varchar(50) DEFAULT NULL,
  `acc_opened_date` date DEFAULT NULL,
  `acc_hol_cnic` varchar(20) DEFAULT NULL,
  `bank_branch_code` varchar(20) DEFAULT NULL,
  `acc_pin` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`acc_no`),
  UNIQUE KEY `acc_hol_cnic_uni` (`acc_hol_cnic`),
  KEY `bank_branch_code` (`bank_branch_code`),
  CONSTRAINT `accounts_ibfk_1` FOREIGN KEY (`bank_branch_code`) REFERENCES `bank` (`bank_branch_code`)
) ENGINE=InnoDB AUTO_INCREMENT=727902593206 DEFAULT CHARSET=latin1;

